import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './styles/Navbar.css';
// import logo from './path-to-your-logo.png'; // Replace with your logo path

function Navbar() {
  const [isMobileMenuOpen, setMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => setMobileMenuOpen(!isMobileMenuOpen);

  return (
    <nav className="navbar">
      <div className="navbar-container">
        {/* <img src={logo} alt="Logo" className="navbar-logo" /> */}
        <button className="navbar-toggle" onClick={toggleMobileMenu}>
          <span className="navbar-toggle-bar"></span>
          <span className="navbar-toggle-bar"></span>
          <span className="navbar-toggle-bar"></span>
        </button>
        <ul className={`navbar-menu ${isMobileMenuOpen ? 'active' : ''}`}>
          <li><Link to="/" className="nav-link">Home</Link></li>
          <li><Link to="/about" className="nav-link">About</Link></li>
          <li className="nav-item dropdown">
            <a href="#" className="nav-link">Services</a>
            <div className="dropdown-menu">
              <Link to="/web-development" className="dropdown-link">Web Development</Link>
              <Link to="/app-development" className="dropdown-link">App Development</Link>
              <Link to="/seo" className="dropdown-link">SEO</Link>
            </div>
          </li>
          <li><Link to="/skills" className="nav-link">Skills</Link></li>
          <li><Link to="/education" className="nav-link">Education</Link></li>
          <li><Link to="/experience" className="nav-link">Experience</Link></li>
          <li><Link to="/work" className="nav-link">Work</Link></li>
          <li><Link to="/certificate" className="nav-link">Certificate</Link></li>
          <li><Link to="/contact" className="nav-link">Contact</Link></li>
        </ul>
        <div className="search-container">
          <input type="text" className="search-bar" placeholder="Search..." />
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
